import React, {Component} from 'react';
import Sunburst from './Sunburst';
import data from './data';
import './datavis.css';
import Calendar from 'react-date-range-calendar';

export default class DataVisualization extends Component {
  constructor(props) {
    super(props);
    this.state = {date: new Date()};
  }

  onChange = date => this.ListeningStateChangedEvent({date})

  render() {
    return (
      <div>
        <div className="calendar-container">
          <Calendar
            onChange={this.onChange}
            value={this.state.date}
            onSelect={(startDate, endDate, validDateRange) => {
              console.log(
                startDate,
                " this is the start date",
                endDate,
                " this is the end date value.......",
                " and this is the validDateRange",
                validDateRange
              );
            }}
          />
        </div>

        <div className="sunburst-wrapper">
          <Sunburst data={data}
            width="1500" 
            height="900"           
            count_member="size"
            labelFunc={(node)=>node.data.name}
            _debug={true}
          />
        </div>
      </div>
    )
  }
}
